return '<div style="width: 100%; height: 100%; padding: 0" fxLayout="column"><tb-dashboard-state class="chart" [ctx]="ctx" [syncParentStateParams]="true" stateId="' + controlsStateName + '"></tb-dashboard-state>' + '</div>';

function getcontrolsStateName(sensorType) {
    if(sensorType === 'GR energy meter' || sensorType === 'GR outside light sensor' || sensorType === 'GR inside light sensor') {
        return 'alarm_settings_kw';
    } else if(sensorType === 'GR harvest reporter') {
        return 'alarm_settings_tons';
    } else if(sensorType === 'GR soil npk sensor') {
        return 'alarm_settings_npk';
    } else if(sensorType === 'GR soil warm moisture sensor') {
        return 'alarm_settings_moisture_temp';
    } else if(sensorType === 'GR water meter') {
        return 'alarm_settings_meters';
    } else if(sensorType === 'GR inside co2 sensor' || sensorType === 'GR soil acidity sensor') {
        return 'alarm_settings_percentage';
    } else if(sensorType === 'GR outside air warm humidity sensor' || sensorType === 'GR inside air warm humidity sensor') {
        return 'alarm_settings_humidity_temp';
    } else {
        return 'unknown_device';
    }
}

